A000055.bio:
a Representative from Alabama; born in Haleyville, Winston County, 
Ala., July 22, 1965; B.A. Birmingham Southern College, Birmingham, Ala., 1987; 
J.D., Samford University, Birmingham, Ala., 1990; lawyer, private practice; 
Haleyville, Ala., municipal judge, 1992-1995; staff for Governor Fob James of 
Alabama, 1995-1996; elected as a Republican to the One Hundred Fifth and to the 
seven succeeding Congresses (January 3, 1997-present).

A000355.bio:
a Senator from Michigan; born in East Lansing, Mich., June 12, 1952; 
attended the public schools in East Lansing; graduated from Michigan State 
University 1974; received J.D. degree from Harvard Law School 1978; admitted to 
the District of Columbia and Michigan bars; chairman, Michigan Republican Party 
1983-1989; deputy chief of staff to Vice President J. Danforth Quayle 1990; 
co-chairman, National Republican Congressional Committee 1990-1992; office 
counsel, Miller, Canfield, Paddock, and Stone 1992-1994; elected as a 
Republican to the United States Senate in 1994, and served from January 3, 
1995, to January 3, 2001; unsuccessful candidate for reelection in 2000; 
Secretary of Energy, 2001-.

G000132.bio:
a Representative from Missouri; born in St. Louis, St. Louis County, 
Mo., January 31, 1941; graduated from South West High School, 1958; B.S., 
Northwestern University, Evanston, Ill., 1962; J.D., University of Michigan Law 
School, 1965; lawyer, private practice; Missouri Air National Guard, 1965-1971; 
Democratic committeeman, St. Louis, Mo., 1968-1971; alderman, St. Louis, Mo., 
1971-1976; elected as a Democrat to the Ninety-fifth and to the thirteen 
succeeding Congresses (January 3, 1977- January 3, 2005); unsuccessful 
candidate for the Democratic presidential nomination in 1988 and in 2004; 
majority leader (One Hundred First through One Hundred Third Congresses); 
minority leader (One Hundred Fourth through One Hundred Seventh Congresses).

L000558.bio:
a Representative from Kentucky;  born in Kenton County, Ky., August 22, 1933;  
graduated from University of Kentucky, Lexington, Ky., 1955;  M.B.A., Xavier University, 1970;  
United States Air Force, 1955-1967;  Florence, Ky., city councilman, 1967-1974;  Boone County, 
Ky.,  commissioner, 1974-1982;  Boone County, Ky., judge-executive, 1992-1998;  elected as a 
Democrat to the One Hundred Sixth and to the two succeeding Congresses (January 3, 1999- January 
3, 2005);  not a candidate for reelection to the One Hundred Ninth Congress in 2004.

M000309.bio:
a Representative from New York; born Carolyn Cook in Brooklyn, Kings 
County, N.Y., January 5, 1944; graduated from Mineola High School, Garden City 
Park, N.Y., 1962; graduated, Glen Cove Nursing School, Glen Cove, N.Y., 1964; 
licensed practical nurse in ICU section, Glen Cove Hospital, Glen Cove, N.Y.; 
elected as a Democrat to the One Hundred Fifth and to the eight succeeding 
Congresses (January 3, 1997-present).

R000409.bio:
a Representative from California; born in Coronado, San Diego 
County, Calif., June 21, 1947; graduated from Palos Verdes High School, Palos 
Verdes Estates, Calif., 1965; attended Los Angeles Harbor College, Los Angeles, 
Calif., 1965-1967; B.A., California State University, Long Beach, Calif., 1969; 
M.A., University of Southern California, Los Angeles, Calif., 1971; journalist; 
assistant press secretary to the Reagan presidential campaigns of 1976 and 
1980; speechwriter and special assistant to President Ronald Reagan, 1981-1988; 
elected as a Republican to the One Hundred First and to the eleven succeeding 
Congresses (January 3, 1989-present).

S001141.bio:
a Senator from Alabama; born in Hybart, Ala., December 24, 1946; 
attended the public schools; graduated from Huntingdon College, Montgomery 
1969; graduated from University of Alabama School of Law, Tuscaloosa 1973; 
admitted to the Alabama bar in 1973, and engaged in the practice of law in 
Russellville 1973-1975; served in the U.S. Army reserves, attaining the rank of 
captain 1973-1977; practiced law in Mobile 1977-1981; United States Attorney 
for the Southern District of Alabama 1981-1993; Alabama Attorney General 
1994-1996; elected as a Republican to the United States Senate in 1996; 
reelected in 2002, and again in 2008 for the term ending January 3, 2015.

V000126.bio:
 a Senator from Ohio; born in Cleveland, Ohio, on July 15, 1936; 
B.A. in government, Ohio University 1958; J.D., Ohio State University College 
of Law 1961; assistant attorney general of Ohio 1963; Ohio state representative 
1967-71; lieutenant governor of Ohio 1979; mayor of Cleveland, Ohio, 1979-89; 
governor of Ohio 1991-1998; chairman of the National Governors Association 
1997-1998; elected as a Republican to the United States Senate in 1998; 
reelected in 2004, and served from January 3, 1999, to January 3, 2011; chair, 
Select Committee on Ethics (One Hundred Ninth Congress); was not a candidate 
for reelection to the Senate in 2010.
